export default function (sizes, availWidth) {
  var passedAvail = false;
  return Object.keys(sizes).filter(function (key) {
    var size = sizes[key];

    if (size.width < availWidth) {
      return true;
    }

    if (passedAvail) {
      return false;
    }

    passedAvail = true;
    return true;
  }).map(function (key) {
    var size = sizes[key];
    return "".concat(size.url, " ").concat(size.width, "w");
  }).join(", ");
}
